import React, { Component } from "react";

import Navbar from "../Components/Navbar.js";

class LandingPage extends Component {
	constructor(props) {
		super(props);
		this.state = {
    	isRegistered: true
  	};
  }

	render() {
		return (
			<div>
				<h1>LandingPage</h1>
			</div>
		);
	}
}
export default LandingPage;
